pragma solidity ^0.8.7;
import {Action,baseproposal} from "./newContrasts/baseproposal.sol";
import "./Finance/finance.sol";

contract Myballot {

    // 
    struct Voter {
        uint256 weight; // 
        bool[] voted; // 
        address delegate; //
        VoteChoice[] choice; // 
    }

    enum VoteChoice {
        Approval,
        Reject,
        abstain
    }

    //  
    address[] public add_contrast_adress;
    // 
    address[] public voter_address;
    mapping(address => Voter) public voters;
    // 
    baseproposal[] public proposals;

    // 
    constructor(address[] memory voteAddressList) payable {
        // chairperson = msg.sender;
        // 
        // voters[chairperson].weight = 1;
        voter_address = voteAddressList;
        for (uint256 i = 0; i < voteAddressList.length; i++) {
            //   
            voters[voteAddressList[i]].weight = 1;
        }
    }

    // 
    function proposalList() public view returns (baseproposal[] memory) {
        return proposals;
    }

    function createProposal(
        string memory _name, 
        string memory _discription,
        uint8 _proposalKind,
        uint8 _proposalStatus,
        uint _startTime,
        uint _endTime
    ) public {
        baseproposal new_proposal = new baseproposal(
            _name, _discription, _proposalKind, _proposalStatus, _startTime, _endTime
        );
        proposals.push(new_proposal);
        for (uint256 i = 0; i < voter_address.length; i++) {
            //   
            address now_address = voter_address[i];
            voters[now_address].voted.push(false);
        }
    }

    function vote(uint256 idx, VoteChoice chioce) public{
        address now_address = msg.sender;
        voters[now_address].voted[idx] = true;
        uint256 now_weight = voters[now_address].weight;
        proposals[idx].setvoteCounts(now_weight);
        if(chioce == VoteChoice.Approval){
            proposals[idx].setvote(now_address,1,0,0);
            voters[now_address].choice[idx] = VoteChoice.Approval;
        }
        if(chioce == VoteChoice.Reject){
            proposals[idx].setvote(now_address,0,1,0);
            voters[now_address].choice[idx] = VoteChoice.Reject;
        }
        if(chioce == VoteChoice.abstain){
            proposals[idx].setvote(now_address,0,0,1);
            voters[now_address].choice[idx] = VoteChoice.abstain;
        }
        voters[now_address].voted[idx] = true;
    }

    function proposal_execute(
        uint256 idx,
        uint256 _allowFailureMap
    )public returns(bytes[] memory execResults, uint256 failureMap){
        return proposals[idx].execute_actions(_allowFailureMap);
    }

        function set_proposal_actions(
        uint256 idx,
        address fuction_address, 
        uint256 money,
        bytes memory _data // abi encode ) public{
    )public{
        Action memory action = Action({
            to: fuction_address,
            value: money,
            data: _data
        });
        proposals[idx].addactions(action);
    }
}
